import React from 'react';
import './Card.css';

const Card = () => {
  return (
    <div className="card">
      <div className="card-header">

      </div>
      <div className="card-buttons">
        <button className="card-button">Overview</button>
        <button className="card-button">Alfa</button>
        <button className="card-button">Beta</button>
      </div>
    </div>
  );
};

export default Card;
